import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './components/header';
import HomeMain from './components/pages/home';




function App() {
  return (
    <div className="App">
      <Router>
      <Switch>
        <Route path="/categories">
          <НоваяСтраница />
        </Route>
        <Route path="/">
          <ГлавнаяСтраница />
        </Route>
      </Switch>
    </Router>

     <Header/>
     <HomeMain/>
    </div>
  );
}

export default App;
